Environment Installation Follow the steps below to setup a new environment. 1. Install Origen Follow these instructions to install Origen: How to Install Origen 2. Create the application workspace This workspace must be situated outside of the Origen workspace that you have just created. Execute the following commands: mkdir origen_core
cd origen_core
dssc setvault .
dssc pop -rec -uni -get -force -ver 0.2.3 . Comments /* * * CONFIGURATION VARIABLES * * */
